import {
    Tab,
    Tabs,
    TabList,
} from '@chakra-ui/react'

export default function Filter(props: any) {
    return (
        <>
            <Tabs variant='soft-rounded' colorScheme='green'>
                <TabList>
                    <Tab>Tab 1</Tab>
                    <Tab>Tab 2</Tab>
                </TabList>
                </Tabs>
        </>
    )
}
